import React, { Component } from 'react'
import './homePage.css'

class HomePage extends Component {
  render(){
    return (
      <div className="home-page">
        <div className="left">
          <h1>Adam Sarli</h1>
        </div>
        <div className="right">
          <img src="/images/homepage-pic2.png" alt="Adam hiking"/>
        </div>
      </div>
    )
  }

}

export default HomePage
